public List<LocalizedMatcher> pullLocalizedMatchers() {
if (matcherStack.isEmpty()) {
return Collections.emptyList();
List<LocalizedMatcher> matchers = new ArrayList<LocalizedMatcher>(matcherStack);
matcherStack.clear();
return (List) matchers;
}

